import React, { useState } from 'react';

const data = [
    {
        "inventory": {
            "inventory_id": 2001,
            "merchandiseCode": 1,
            "inStockQuantity": 300,
            "unit": "piece",
            "siteCode": 101
        },
        "site": {
            "site_code": 101,
            "siteName": "Hanoi",
            "byShip": 500,
            "byAir": 300,
            "otherInfo": "Main warehouse"
        }
    },
    {
        "inventory": {
            "inventory_id": 2002,
            "merchandiseCode": 2,
            "inStockQuantity": 500,
            "unit": "piece",
            "siteCode": 102
        },
        "site": {
            "site_code": 102,
            "siteName": "Ho Chi Minh",
            "byShip": 400,
            "byAir": 200,
            "otherInfo": "Secondary site"
        }
    },
    {
        "inventory": {
            "inventory_id": 2006,
            "merchandiseCode": 2,
            "inStockQuantity": 150,
            "unit": "piece",
            "siteCode": 101
        },
        "site": {
            "site_code": 101,
            "siteName": "Hanoi",
            "byShip": 500,
            "byAir": 300,
            "otherInfo": "Main warehouse"
        }
    }
];

const SiteInventoryItem = ({ data }) => {
    const [expandedSites, setExpandedSites] = useState([]);

    const handleSiteClick = (siteCode) => {
        setExpandedSites((prev) =>
            prev.includes(siteCode) ? prev.filter((code) => code !== siteCode) : [...prev, siteCode]
        );
    };

    // Lọc dữ liệu để chỉ hiển thị mỗi site một lần
    const uniqueSites = Array.from(new Set(data.map((item) => item.site.site_code))).map((siteCode) =>
        data.find((item) => item.site.site_code === siteCode)
    );

    return (
        <div>
            <table>
                <thead>
                    <tr>
                        <th>Site Code</th>
                        <th>Site Name</th>
                        <th>By Ship</th>
                        <th>By Air</th>
                        <th>Other Info</th>
                    </tr>
                </thead>
                <tbody>
                    {uniqueSites.map((item, index) => (
                        <React.Fragment key={index}>
                            <tr onClick={() => handleSiteClick(item.site.site_code)}>
                                <td>{item.site.site_code}</td>
                                <td>{item.site.siteName}</td>
                                <td>{item.site.byShip}</td>
                                <td>{item.site.byAir}</td>
                                <td>{item.site.otherInfo}</td>
                            </tr>
                            {expandedSites.includes(item.site.site_code) &&
                                data
                                    .filter((inventoryItem) => inventoryItem.site.site_code === item.site.site_code)
                                    .map((inventoryItem, invIndex) => (
                                        <tr key={`${index}-${invIndex}`} className="inventory-row">
                                            <td colSpan="5">
                                                <table>
                                                    <thead>
                                                        <tr>
                                                            <th>Inventory ID</th>
                                                            <th>Merchandise Code</th>
                                                            <th>In Stock Quantity</th>
                                                            <th>Unit</th>
                                                        </tr>
                                                    </thead>
                                                    <tbody>
                                                        <tr>
                                                            <td>{inventoryItem.inventory.inventory_id}</td>
                                                            <td>{inventoryItem.inventory.merchandiseCode}</td>
                                                            <td>{inventoryItem.inventory.inStockQuantity}</td>
                                                            <td>{inventoryItem.inventory.unit}</td>
                                                        </tr>
                                                    </tbody>
                                                </table>
                                            </td>
                                        </tr>
                                    ))}
                        </React.Fragment>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default SiteInventoryItem;
